import React from 'react';

function MemeList({ memes, removeMeme }) {
    if (!Array.isArray(memes)) {
        return null;
    }

    return (
        <div className="meme-list">
            {memes.map((meme, index) => (
                <div key={index} className="meme">
                    <p>{meme.text}</p>
                    {meme.imageUrl && <img src={`http://localhost:3001${meme.imageUrl}`} alt={meme.text} />}
                    <button onClick={() => removeMeme(meme._id)}>Supprimer</button>
                </div>
            ))}
        </div>
    );
}

export default MemeList;
